import React,{useState} from "react";
import Carousel from "react-bootstrap/Carousel";
import img from "./images/1.jpg";




function carousel(){

    const[index,setIndex]=useState(1)

    const handleSelect=(selectedIndex,e) =>{
        setIndex(selectedIndex);

    };
    return(
        <div>
            <Carousel fade="true" activeIndex={index} onSelect={handleSelect}>
                <Carousel.Item>
                    <img className="d-block w-100" src={require("./images/1.jpg")}
                    alt=" First Image" style={{height:"100vh"}}
                    />
                    <Carousel.Caption>
                      <h3>Delicious quality chicken Biriyani</h3>  
                      <p>hii hello</p>
                    </Carousel.Caption>
               </Carousel.Item>

               <Carousel.Item>
                    <img className="d-block w-100" src={require("./images/2.jpg")}
                    alt=" Second Image" style={{height:"100vh"}}
                    />
                    <Carousel.Caption>
                      <h3>Protien Rich Biriyani</h3>  
                      <p>hii hello</p>
                    </Carousel.Caption>
               </Carousel.Item>
            </Carousel>

        </div>
    )
}

export default carousel
